description:
King of the Outlaws - Butch Cassidy and the Wild Bunch. The-Hole-In-The-Wall Gang! The biggest and toughest gang in the West - who operated from a mountain fortress, a hole in the hills - robbed, looted, murdered, standing off even the U.S. Cavalry.

Published by Avon Comics.

